import React from 'react';
import {Button, Container, Nav, Navbar} from "react-bootstrap";
import {NavLink, useNavigate} from "react-router-dom";
import {MAIN_ROUTE, ORDERPAGE_ROUTE} from "../utils";
import {observer} from "mobx-react-lite";


const MyNavBar = observer(() => {
    const navigate = useNavigate
    return (
        <Navbar bg="dark" variant="dark">
            <Container>
                <NavLink style={{color:"white"}} to={MAIN_ROUTE}> Головна</NavLink>
                <Nav className="ml-auto" style={{color:"white", height:50}} >
                    <Button
                        variant={"outline-light"}
                        className="me-3 mt-2"
                        style={{height:36}}
                        onClick={()=> navigate(ORDERPAGE_ROUTE)}
                    > Зробити замовлення</Button>
                </Nav>
            </Container>
        </Navbar>
    );
}) ;

export default MyNavBar;
